import logo_stackoverflow from './logo_stackoverflow.svg';
import React from 'react';

import React_dom from 'react-dom';
import About from './components/About.jsx'
import Products from './components/Products.jsx'
import ForTeams from './components/ForTeams.jsx'

import './App.css';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <header className="App-header">
      <nav>
        <Router>
        <Link to ='/'>Home</Link>
        <Link to ='./components/About.jsx'>About</Link>
        <Link to ='./components/Products.jsx'> Products</Link>
        <Link to ='./components/ForTeams.jsx'>For Teams</Link>

        <Routes>
          <Route path ='./components/About.jsx' element={About} />
          <Route path ='./components/Products.jsx' element = {Products} />
          <Route path ='./components/ForTeams.jsx' element = {Products} />


        </Routes>

        </Router>
      </nav>
      </header>
    </div>
  );
}

export default App;
